//   name: 'John Doe',
//   email: 'johndoe@mail.com',
//   location: { country: { name: 'Canada', abbr: 'CA' }, place: 'Tokyo' },
//   phone: [ 123 ],
//   age: 2001-08-15T15:28:37.453Z
// }
