## Suggestion
`debounce` and `throttle` both have a argument `wait`, now it only accepts `number` type, suggest to allow use custom wait function.

## Examples
```ts
import { delay, debounce } from 'lodash'; 

const mockApi = () => fetch('someUrl');

/** current api */
const debounced = debounce(mockApi, 1000);
/** same as (but with empty cancel method implements) */
const debounced = debounce(mockApi, callback => delay(callback, 1000));

/** mostly use case */
const debounced = debounce(mockApi, requestAnimationFrame);

/** with cancel function */
const debounced = debounce(mockApi, { flush: requestAnimationFrame, cancel: cancelAnimationFrame });

/** debounce mockApi until anotherMockApi end */ 
const anotherMockApi = () => fetch('someUrl');
const debounced = debounce(mockApi, callback => anotherMockApi().then(callback));

/** cancelable fetch */
const anotherMockApi = callback => {
    const  abortController = new AbortController();
    fetch('someUrl', { signal: abortController.signal }).then(callback);
    return abortController;
};
/** use flush function return value as cancel function param */
const debounced = debounce(mockApi, {
    flush: anotherMockApi,
    cancel: abortController => abortController.abort()
});

/** if don't like the object parameter, there is an alternative cancelable design which use closure */
const debounced = debounce(mockApi,  callback => {
    const  abortController = new AbortController();
    fetch('someUrl', { signal: abortController.signal }).then(callback);
    return () => abortController.abort();
});
/** but mostly use case will be ugly */
const debounced = debounce(mockApi, callback => {
    const timer = requestAnimationFrame(callback);
    return () => cancelAnimationFrame(timer);
});
```


