I found clonedeep cannot clone an object with its descriptors. But it easy to solve this problem!
if value is an object 
```js
const allDescriptors=Object.getOwnPropertyDescriptors(obj);
Object.defineProperties(cloneObj,allDescriptors);
```
In this way, we could copy all descriptors correctly! Belows are the complete code I implemented myself:
```js
const isComplexObject=obj=> (obj instanceof Object && typeof obj !=="function");
const deepClone=(obj,hashMap=new WeakMap())=>{
	if (!isComplexObject(obj)){
		return obj;
	}else {
		let cloneObj;
		const constructor=obj.constructor;
		const allDescriptors=Object.getOwnPropertyDescriptors(obj);

		if (/^(Date|RegExp)$/i.test(constructor.name)){
			cloneObj=new constructor(obj);
			Object.defineProperties(cloneObj,allDescriptors);
			return cloneObj;
		}

		if (constructor.name==='Map'){
			cloneObj=new constructor();
			Object.defineProperties(cloneObj,allDescriptors);
			obj.forEach((key,value)=>{
				cloneObj.set(key,deepClone(value,hashMap));
			})
			return cloneObj;
		}

		if (constructor.name==='Set'){
			cloneObj=new constructor();
			Object.defineProperties(cloneObj,allDescriptors);
			obj.forEach(value=>{
				cloneObj.add(deepClone(value,hashMap));
			})
			return cloneObj;
		}

		if (hashMap.has(obj)){
			return hashMap.get(obj);
		}
		cloneObj=Object.create(Object.getPrototypeOf(obj),allDescriptors);
		hashMap.set(obj,cloneObj);
		for (let key of Reflect.ownKeys(obj)) {
			cloneObj[key]=deepClone(obj[key],hashMap);
		}
		return cloneObj;
	}
}
```

